import React from "react";

export default function ResumeAwards() {
  return (
    <div className="resume-awards">
      <h4>Awards</h4>
      <ul>
        <li>Best Soccer Player in two succesive seasons</li>
        <li>Best Overall student in system design</li>
      </ul>
    </div>
  );
}
